    EditOutlined
  } from '@ant-design/icons';
import { Link} from 'react-router-dom'
import './dificultList.css'
const axios = require('axios');

export default function DificultList() {


    const [dificults, setDificults] = useState([])
    const [reloadDificults, setReloadDificults] = useState(false)

    /*
    useEffect(() =>{
            axios.get('http://67.205.155.156:4500/api/dificultad')
            .then(res => {setDificults(res.data)})
            .catch(console.log)
   },[setDificults]) 
    */

   console.log(dificults);
   useEffect(() =>{
    axios.get('http://67.205.155.156:4500/api/dificultad')
    .then(res => {setDificults(res.data)})
    .catch(console.log)
    setReloadDificults(false)
},[reloadDificults]) 

    return (
        <div className='dificultList'>
            <h1>Dificultades List</h1>
            <List 
                className="dificult"
                itemLayout="horizontal"
                dataSource={dificults}
                renderItem={dificult => (
                    <List.Item
                        actions={[
                            <Button 
                                type="primary"
                                onClick={() => console.log("Editar")}
                            ><EditOutlined /></Button>
                        ]}
                    >
                        <List.Item.Meta 
                            title={`
                                ${dificult.nombre}
                            `}
                        />
                    </List.Item>
                )}
            />
        </div>
    )
}

